  example_user_data = [
    {
      first_name: "Luke",
      last_name: "Skywalker",
      trade_name: "Plumber"
    },
    {
      first_name: "General",
      last_name: "Akkbar",
      trade_name: "General Manager"
    },
    {
      first_name: "Obi-wan",
      last_name: "Kenobi",
      trade_name: "Technician"
    },
    {
      first_name: "Han",
      last_name: "Solo",
      trade_name: "General Contractor"
    },
    {
      first_name: "Lando",
      last_name: "Calrissian",
      trade_name: "Project Manager"
    }
  ];



  componentDidMount() {
    setTimeout(()=>{
      this.setState({loaded: true});
      this.setState({users: [...this.example_user_data]})
    }, 5000);
  }

  SelectTask = (e) => {
